import React, { Component } from 'react'

export default class Movies extends Component {
    render() {
        return (
            <div  className="DisplayMovies">
            <img src={this.props.movie.posterUrl} alt='Movie poster'/>
            <ul>
                <li>Title : {this.props.movie.title}</li>
                <li>Director : {this.props.movie.director}</li>
                <li>Actors : {this.props.movie.actors}</li>
                <li>Genres : {this.props.movie.genres}</li>
                <li>Year : {this.props.movie.year}</li>
                <li>Plot : {this.props.movie.plot}</li>
            </ul>
        </div>
        )
    }
}
